def verify_integrity():
    current_hash = hashlib.sha256(DATA.encode()).hexdigest()
    if current_hash != HASH:
        print("[!] Intégrité compromise !")
        return False
    print("[+] Intégrité : OK.")
    return True

def run():
    try:
        pwd = getpass.getpass("Mot de passe : ")
        if hashlib.sha256(pwd.encode()).hexdigest() != PW_HASH:
            print("[!] Mot de passe incorrect.")
            return
        encrypted = b64.b85decode(DATA)
        cipher = AES.new(KEY, AES.MODE_CBC, IV)
        decrypted = _u(cipher.decrypt(encrypted), AES.block_size)
        code = zlib.decompress(decrypted)
        exec(code, {'__name__': '__main__'})
    except Exception as e:
        print("[!] Erreur d'exécution :", e)

def menu():
    while True:
        print("\n[ Menu de sécurité ]")
        print("1. Lancer le script")
        print("2. Vérifier les mises à jour")
        print("3. Vérifier l'intégrité")
        print("4. Quitter")
        choice = input("> ")

        if choice == "1":
            if verify_integrity():
                run()
        elif choice == "2":
            check_update()
        elif choice == "3":
            verify_integrity()
        elif choice == "4":
            break
        else:
            print("Choix invalide.")

if __name__ == '__main__':
    menu()
